// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/**
 * @title Voting
 * @dev Election voting system contract
 */
contract Voting {
    // Structure for Position
    struct Position {
        uint256 id;
        string name;
        bool active;
    }
    
    // Structure for Candidate
    struct Candidate {
        uint256 id;
        string name;
        uint256 positionId;
        uint256 voteCount;
    }
    
    // Structure for Voter
    struct Voter {
        address voterAddress;
        bool hasVoted;
        uint256[] votedPositions;
    }
    
    // State variables
    uint256 public positionCount;
    uint256 public candidateCount;
    address public owner;
    
    // Mapping for positions, candidates and voters
    mapping(uint256 => Position) public positions;
    mapping(uint256 => Candidate) public candidates;
    mapping(address => Voter) public voters;
    
    // Events
    event PositionAdded(uint256 id, string name);
    event CandidateAdded(uint256 id, string name, uint256 positionId);
    event VoteCasted(address voter, uint256 candidateId, uint256 positionId);
    
    // Modifiers
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can perform this action");
        _;
    }
    
    // Constructor
    constructor() {
        owner = msg.sender;
        positionCount = 0;
        candidateCount = 0;
    }
    
    // Function to add a position
    function addPosition(string memory _name) public onlyOwner {
        positionCount++;
        positions[positionCount] = Position(positionCount, _name, true);
        emit PositionAdded(positionCount, _name);
    }
    
    // Function to add a candidate
    function addCandidate(string memory _name, uint256 _positionId) public onlyOwner {
        require(_positionId > 0 && _positionId <= positionCount, "Invalid position ID");
        require(positions[_positionId].active, "Position is not active");
        
        candidateCount++;
        candidates[candidateCount] = Candidate(candidateCount, _name, _positionId, 0);
        emit CandidateAdded(candidateCount, _name, _positionId);
    }
    
    // Function to cast a vote
    function vote(uint256 _candidateId) public {
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");
        
        uint256 positionId = candidates[_candidateId].positionId;
        Voter storage voter = voters[msg.sender];
        
        // Check if voter has already voted for this position
        for (uint256 i = 0; i < voter.votedPositions.length; i++) {
            require(voter.votedPositions[i] != positionId, "Already voted for this position");
        }
        
        // Register vote
        candidates[_candidateId].voteCount++;
        
        // Register voter's action
        if (!voter.hasVoted) {
            voter.voterAddress = msg.sender;
            voter.hasVoted = true;
        }
        voter.votedPositions.push(positionId);
        
        emit VoteCasted(msg.sender, _candidateId, positionId);
    }
    
    // Function to get candidate count
    function getCandidateCount() public view returns (uint256) {
        return candidateCount;
    }
    
    // Function to get a candidate's vote count
    function getCandidateVotes(uint256 _candidateId) public view returns (uint256) {
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");
        return candidates[_candidateId].voteCount;
    }
    
    // Function to check if a voter has voted for a specific position
    function hasVotedForPosition(address _voter, uint256 _positionId) public view returns (bool) {
        require(_positionId > 0 && _positionId <= positionCount, "Invalid position ID");
        
        Voter storage voter = voters[_voter];
        if (!voter.hasVoted) {
            return false;
        }
        
        for (uint256 i = 0; i < voter.votedPositions.length; i++) {
            if (voter.votedPositions[i] == _positionId) {
                return true;
            }
        }
        
        return false;
    }
    
    // Function to deactivate a position
    function deactivatePosition(uint256 _positionId) public onlyOwner {
        require(_positionId > 0 && _positionId <= positionCount, "Invalid position ID");
        positions[_positionId].active = false;
    }
    
    // Function to activate a position
    function activatePosition(uint256 _positionId) public onlyOwner {
        require(_positionId > 0 && _positionId <= positionCount, "Invalid position ID");
        positions[_positionId].active = true;
    }
}

